import * as Constants from "../../constants";

function rename(obj) {
    let newNameObj = {};
    let allName = Object.keys(obj);
    console.log(allName);

    for (let i = 0; i < Object.keys(obj).length; i++) {
        let name = allName[i];
        console.log(Constants.KEYSMAP[name]);

        newNameObj[Constants.KEYSMAP[name]] = obj[Constants.KEYSMAP[i]];
        console.log(newNameObj);
    }

    return newNameObj
}


export default function renameKeys (obj) {

    console.log(Object.keys(obj).length,Constants.KEYSMAP )

    let newArrAllEvents = [];

    for (let i = 0; i < Object.keys(obj).length; i++) {
